			shellScript = "# Type a script or drag a script file from your workspace to insert its path.\nset -e  # Exit immediately if a command fails\n\necho \"------------------------------------\"\necho \"üî• Firebase Config Copy Script\"\necho \"Active configuration: ${CONFIGURATION}\"\necho \"------------------------------------\"\n\n# Path to your Firebase plist files\nCONFIGS_DIR=\"${PROJECT_DIR}/SchoolFirst/Configurations\"\n\n# Destination inside the app bundle (use the resources folder, not the app root)\nDESTINATION=\"${TARGET_BUILD_DIR}/${UNLOCALIZED_RESOURCES_FOLDER_PATH}\"\necho \"Listing config folder contents:\"\nls -l \"${CONFIGS_DIR}\"\n# Remove any old plist first\nrm -f \"${DESTINATION}/GoogleService-Info.plist\"\n\n# Match all your configurations properly\ncase \"${CONFIGURATION}\" in\n    \"Debug Dev\"|\"Release Dev\")\n        cp \"${CONFIGS_DIR}/GoogleService-Info-DEV.plist\" \"${DESTINATION}/GoogleService-Info.plist\"\n        echo \"‚úÖ Copied DEV Firebase config (${CONFIGURATION})\"\n        ;;\n    \"Debug\"|\"Release\")\n        cp \"${CONFIGS_DIR}/GoogleService-Info-PROD.plist\" \"${DESTINATION}/GoogleService-Info.plist\"\n        echo \"‚úÖ Copied PROD Firebase config (${CONFIGURATION})\"\n        ;;\n    *)\n        echo \"‚ö†Ô∏è Unknown configuration: ${CONFIGURATION}\"\n        echo \"Available files in ${CONFIGS_DIR}:\"\n        ls -l \"${CONFIGS_DIR}\"\n        ;;\nesac\n\n# Confirm the file exists\nif [ -f \"${DESTINATION}/GoogleService-Info.plist\" ]; then\n    echo \"üì¶ Firebase plist copied successfully:\"\n    ls -l \"${DESTINATION}/GoogleService-Info.plist\"\nelse\n    echo \"‚ùå Firebase plist NOT FOUND in ${DESTINATION}\"\n    exit 1\nfi\n\necho \"------------------------------------\"\n";
